    false,nt"url": null,nt"notes": "This annual narrative report for Sand Lake
    WMD outlines Refuge accomplishments during the 1971 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, vegetation control,
    and wildfires. Resource management is outlined; topics include grazing, haying,
    and fur harvesting. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, hunting, and violations. Items of interest
    and newspaper articles are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
